            height: 2em;
            line-height: 2em;
            h1 {
                font-size: 2em;
            }
        }

        .contacto__container {
            position: absolute;
            top: 25%;
            width: 100%;
            height: 80%;
            display: block;

            .contacto__left {
                position: absolute;
                width: 25%;
                padding: 2%;
                form {
                    position: relative;
                    top: 10%;
                }
            }

            .contacto__right {
                position: absolute;
                width: 20%;
                left: 27%;
                padding: 0;

                .contacto__right--logo {
                    display: relative;
                    top: 10%;
                    left: 5%;
                }
                .contacto__right--ubicacion {
                    position: relative;
                    width: 100%;
                    left: 5%;
                    top: 30%;
                }
                .contacto__right--iconos {
                    left: 5%;
                    top: 60%;
                }
                .contacto__right--text {
                    left: 17%;
                }
            }

        }

        .contacto__map {
            position: absolute;
            width: 100%;
            height: 80%;
            top: 25%;
            iframe {
                position: absolute;
                height: 100%;
                transform: translateY(0);
                top: 0;
                width: 51%;
                top: 0;
                left: 49%;
                z-index: -1;
                border-radius: 5px;
            }
        }
    }
}

